import React from 'react'
import { NavLink } from 'react-router-dom'

export default function landingPage() {
  return (
    <div className="landing">
        <h1>Welcome to the Countries App</h1>
        <NavLink to="/countries">
            <button>Get Started</button>
        </NavLink>
        </div>
  )
}
